import React from 'react'
import { View, Text , FlatList} from 'react-native'
import chats from '../../constants/chats'

export default function AllDms() {
    return (
        <View>
             <FlatList
                data={chats}
                keyExtractor={(item) => item.id}
                renderItem={({ item, index }) => (
                <>
                <Text>Hii</Text>
                </>
                )}
          />
        </View>
    )
}
